import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () =>{
    return(
    <>
    <h1 className="text-center m-3">Official Netflix Movies</h1>,
   {Sdata.map((val, index)=>{
     return(
       <Card
         imgsrc={val.imgsrc}
         category={val.category}
         title={val.title}
         link={val.link}
       />
     )
   })}
     
    </>
    )
}
export default App;
